import React, { useState, useEffect } from 'react';
import './App.css';
import { Bar, Line, Pie, Doughnut } from 'react-chartjs-2';
import Papa from 'papaparse';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  ArcElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  ArcElement,
  Title,
  Tooltip,
  Legend
);

function App() {
  const [currentSection, setCurrentSection] = useState('dashboard');
  const [chartData, setChartData] = useState({
    vehicleData: null,
    energyData: null,
    stationData: null,
    usageData: null
  });
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    // Generate mock data since we don't have actual CSV
    const generateMockData = () => {
      const months = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'];
      const vehicleCounts = months.map(() => Math.floor(Math.random() * 500) + 800);
      const energyUsage = months.map(() => Math.floor(Math.random() * 200) + 100);
      const stationActivity = [35, 25, 15, 10, 15];
      const usageByTime = Array.from({length: 24}, (_, i) => ({
        hour: i,
        usage: Math.floor(Math.random() * 80) + 20
      }));
      
      setChartData({
        vehicleData: {
          labels: months,
          datasets: [{
            label: 'Total Vehicles',
            data: vehicleCounts,
            backgroundColor: 'rgba(54, 162, 235, 0.5)',
            borderColor: 'rgb(54, 162, 235)',
            borderWidth: 1
          }]
        },
        energyData: {
          labels: months,
          datasets: [{
            label: 'Energy Consumption (kWh)',
            data: energyUsage,
            backgroundColor: 'rgba(255, 99, 132, 0.2)',
            borderColor: 'rgb(255, 99, 132)',
            borderWidth: 2,
            tension: 0.3,
            fill: true
          }]
        },
        stationData: {
          labels: ['Urban', 'Suburban', 'Highway', 'Rural', 'Commercial'],
          datasets: [{
            label: 'Charging Station Distribution',
            data: stationActivity,
            backgroundColor: [
              'rgba(255, 99, 132, 0.6)',
              'rgba(54, 162, 235, 0.6)',
              'rgba(255, 206, 86, 0.6)',
              'rgba(75, 192, 192, 0.6)',
              'rgba(153, 102, 255, 0.6)',
            ],
            borderColor: [
              'rgb(255, 99, 132)',
              'rgb(54, 162, 235)',
              'rgb(255, 206, 86)',
              'rgb(75, 192, 192)',
              'rgb(153, 102, 255)',
            ],
            borderWidth: 1
          }]
        },
        usageData: {
          labels: usageByTime.map(item => `${item.hour}:00`),
          datasets: [{
            label: 'Hourly Usage',
            data: usageByTime.map(item => item.usage),
            backgroundColor: 'rgba(75, 192, 192, 0.5)',
            borderColor: 'rgb(75, 192, 192)',
            borderWidth: 1
          }]
        }
      });
      
      setIsLoading(false);
    };
    
    setTimeout(generateMockData, 1000); // Simulate loading delay
  }, []);

  const barOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Monthly Vehicle Registration',
      },
    },
  };

  const lineOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Energy Consumption Trends',
      },
    },
  };
  
  const pieOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'right',
      },
      title: {
        display: true,
        text: 'Charging Station Distribution',
      },
    },
  };

  const hourlyOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Hourly Charging Activity',
      },
    },
    scales: {
      y: {
        beginAtZero: true,
        title: {
          display: true,
          text: 'Usage Count'
        }
      },
      x: {
        title: {
          display: true,
          text: 'Hour of Day'
        }
      }
    }
  };

  return (
    <div className="App">
      <nav className="navbar">
        <div className="navbar-brand">
          <h1>EV Analytics Dashboard</h1>
        </div>
        
        <ul className="navbar-links">
          <li><a href="#dashboard" onClick={() => setCurrentSection('dashboard')} className={currentSection === 'dashboard' ? 'active' : ''}>Dashboard</a></li>
          <li><a href="#analytics" onClick={() => setCurrentSection('analytics')} className={currentSection === 'analytics' ? 'active' : ''}>Analytics</a></li>
          <li><a href="#reports" onClick={() => setCurrentSection('reports')} className={currentSection === 'reports' ? 'active' : ''}>Reports</a></li>
          <li><a href="#settings" onClick={() => setCurrentSection('settings')} className={currentSection === 'settings' ? 'active' : ''}>Settings</a></li>
        </ul>
      </nav>
      
      <main className="content">
        <section id="dashboard" className="dashboard-container">
          <h2>EV Analytics Overview</h2>
          
          {isLoading ? (
            <div className="loading-spinner">Loading data...</div>
          ) : (
            <>
              <div className="dashboard-grid">
                <div className="dashboard-card">
                  <h3>Total Vehicles</h3>
                  <p className="metric">1,248</p>
                  <p className="trend positive">+12% from last month</p>
                </div>
                <div className="dashboard-card">
                  <h3>Average Charge Time</h3>
                  <p className="metric">42 min</p>
                  <p className="trend negative">+5% from last month</p>
                </div>
                <div className="dashboard-card">
                  <h3>Energy Consumption</h3>
                  <p className="metric">284 kWh</p>
                  <p className="trend positive">-8% from last month</p>
                </div>
                <div className="dashboard-card">
                  <h3>Active Stations</h3>
                  <p className="metric">89</p>
                  <p className="trend neutral">No change</p>
                </div>
              </div>
              
              <div className="charts-container">
                <div className="chart-wrapper">
                  <Bar data={chartData.vehicleData} options={barOptions} />
                </div>
                <div className="chart-wrapper">
                  <Line data={chartData.energyData} options={lineOptions} />
                </div>
                <div className="chart-row">
                  <div className="chart-wrapper half-width">
                    <Pie data={chartData.stationData} options={pieOptions} />
                  </div>
                  <div className="chart-wrapper half-width">
                    <Doughnut data={chartData.stationData} options={pieOptions} />
                  </div>
                </div>
                <div className="chart-wrapper">
                  <Bar data={chartData.usageData} options={hourlyOptions} />
                </div>
              </div>
            </>
          )}
        </section>
      </main>
      
      <footer className="footer">
        <div className="footer-content">
          <p>© 2025 EV Analytics Dashboard. All rights reserved.</p>
          <div className="footer-links">
            <a href="#privacy">Privacy Policy</a>
            <a href="#terms">Terms of Service</a>
            <a href="#contact">Contact</a>
          </div>
        </div>
      </footer>
    </div>
  );
}

export default App;
